import React from "react";
import Header from "./Header";
import Footer from "./footer";
import Note from "./Note";
import notes from "../notes";

function App(){
    return <div><Header /><Note title={notes.title[0]} content={notes.content[0]}/><Footer /></div>;
}

export default App;
